    return(
        <div className="video">
            <h2 className="video__header">Next Videos</h2>

     {   props.video.map((e) => {
            return(
                <div key={e.id}className="video__videoContainer">
                    <img src={e.image}></img>
                    <div>
                        <p>{e.title}</p>
                        <p>{e.channel}</p>
                    </div>
                </div>
            );
            })
    }

        </div>
    );
}

export default NextVideo;
